  true,\n\t\"url\": null,\n\t\"notes\": \"VA's Homeless Providers Grant and Per Diem
  Program is offered annually (as funding permits) by the Department of Veterans Affairs
  Health Care for Homeless Veterans (HCHV) Programs to fund community agencies providing
  services to homeless Veterans. The purpose is to promote the development and provision
  of supportive housing and/or supportive services with the goal of helping homeless
  Veterans achieve residential stability, increase their skill levels and/or income,
  and obtain greater self-determination.  Only programs with supportive housing (up
  to 24 months) or service centers (offering services such as case management, education,
  crisis intervention, counseling, services targeted towards specialized populations
  including homeless women Veterans, etc.) are eligible for these funds. The program
  has two levels of funding: the Grant Component and the Per Diem Component.  Grants:
  Limit is 65% of the costs of construction, renovation, or acquisition of a building
  for use as service centers or transitional housing.\",\n\t\"license_title\": \"Creative
